import React from 'react';
import {Comment, CommentAvatar, CommentContent} from 'semantic-ui-react';

const CommentDetail = props => {
  return (
    <Comment>
      <CommentAvatar>
        <img alt="avatar" src={props.avatar} />
      </CommentAvatar>
      <CommentContent>
        <Comment.Author>
          {props.author}
        </Comment.Author>
        <Comment.Metadata>
          <span>{props.timeAgo}</span>
        </Comment.Metadata>
        <Comment.Text>{props.content}</Comment.Text>
      </CommentContent>
    </Comment>
  );
};

export default CommentDetail;
